import './App.css';
import react ,{useState}from "react";
function App() {
  const [name,setname]= useState("Start")
const handleClick=(e)=>{
    if(e.target.valu==="start"){
      setname('Stop')
    }
}
  return (
    <div className="App">
      <h1>StopWatch</h1>
      <h4>Time: <span>00:00</span>

      </h4>
      <button onClick={handleClick}>{name}</button>
      <button>Reset</button>
    </div>
  );
}

export default App;
